import React, { useEffect, useState } from 'react'
import './Allpost.css'
import axios from 'axios'
function Allpost() {
    const [images, setImages] = useState([]);
    useEffect(()=>{
        getPost()
    })
    URL.createObjectURL(images)
    const getPost = async ()=>{
        try {
            const response = axios.get('http://localhost:4000/post', {
                headers: {
                    Authorization: 'eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJfaWQiOiI2NWI4YjlhNGVkMmI4MjFkZDY0OWY1NjYiLCJuYW1lIjoiYmFuZGFyIiwiZW1haWwiOiJibmRkcmdhbWVyQGdtYWlsLmNvbSIsImlhdCI6MTcwNjYwNDk4Mn0.lPoHWeEIEP7WyiOSzO92OizpH4DiZtTpjYDbwMBs0LE'
                }
            }).then(res=> {
            setImages(response.data.img)
        })
        } catch (e) {
            console.log(e)
        }
    }
  return (
    <>
        <div className='post-container'>
            <div>
                {
                    images.map(img=> img.setImages(img))
                }
                <img alt='Error' src={images}/>
            </div>
        </div>
    </>
  )
}

export default Allpost
